<?php

namespace Tests\Unit;

use App\Models\Advert;
use App\Models\User;
use Illuminate\Foundation\Testing\RefreshDatabase;
use Tests\TestCase;

class DocumentsTest extends TestCase
{
    public function testRequestCreateDocuments()
    {

        $types = [
            'documents' =>
                [
                    [
                        'data' => '',
                        'mime' => 'image/jpeg',
                        'user_id' => '1',
                        'advert_id' => null,
                        'file_name' => 'IMG_0001.JPG'
                    ]
                ]];

        $response = $this->post('api/documents/create', $types);

        $response->assertStatus(201);
    }
}
